<!DOCTYPE html>
<html lang="en">

<head>

	<meta charset="UTF-8">
	<title>Document</title>
	<style>

		
		body {
			width: 100vw;
			height: 100vh;
			overflow: hidden;
			margin-top: -740px;
			margin-left: -45px;
		}
		
		#aLpha {
			visibility: hidden;
		}
		
		#sun {
			animation: rise 270s infinite;
		}
		
		#sky {
			width: 45%;
			height: 100%;
			z-index: -100;
			top: 0;
			right: 5%;
			position: absolute;
			background: rgba(255, 239, 66, 1);
			background: -webkit-linear-gradient(rgba(255, 239, 66, 1) 0%, rgba(89, 197, 255, 1) 100%);
			background: -o-linear-gradient(rgba(255, 239, 66, 1) 0%, rgba(89, 197, 255, 1) 100%);
			background: linear-gradient(rgba(255, 239, 66, 1) 0%, rgba(89, 197, 255, 1) 100%);
			filter: progid: DXImageTransform.Microsoft.gradient( startColorstr='#ffef42', endColorstr='#59c5ff', GradientType=0);
			animation: day 300s infinite;
		}
		
		@keyframes day {
			0% {
				transform: translate(0, 0);
			}
			100% {
				transform: translate(0, -50%);
			}
		}
		
		@keyframes rise {
			0% {
				transform: translate(0, 0);
			}
			100% {
				transform: translate(100%, -50%);
			}
		}
		/*		BOOK*/
		
		#lights {
			visibility: hidden;
		}
		#bulbon {
			visibility: hidden;
		}
		
		#scrsaver {
			animation: move 20s infinite;
			animation-timing-function: linear;
			/*			top left corner*/
		}
		
		@keyframes move {
			0% {
				transform: translate(-16px, -38px);
			}
			20% {
				transform: translate(20px, 33px);
			}
			40% {
				transform: translate(74px, 10px);
			}
			60% {
				transform: translate(20px, -38px);
			}
			80% {
				transform: translate(-10px, 30px);
			}
			85% {
				transform: translate(-20px, 20px);
			}
			100% {
				transform: translate(-16px, -38px);
			}
		}
		
		#book {
			background-image: url('foolbook.png');
			background-repeat: no-repeat;
			background-position: center;
			background-size: contain;
			position: absolute;
			width: 500px;
			height: 500px;
			top: 0;
			bottom: 0;
			left: 0;
			right: 0;
			margin: auto;
			display: none;
		}
		
		#list {
			font-size: 12px;
			top: 0;
			bottom: 0;
			right: 0;
			left: 0;
			margin: auto;
			padding-top: 20%;
			padding-left: 60%;
			font-family: 'script', 'whateverittakes';
			color: darkgray;
			font-size: 12pt;
		}
		/*		DRAWERS*/
		
		#drawer1 {
			transition: 1s;
		}
		
		#drawer2 {
			transition: 1s;
		}
		
		#drawer3 {
			transition: 1s;
		}
		
		#drawer4 {
			transition: 1s;
		}
		/*		COMPUTER*/
		
		#fact1 {
			visibility: hidden;
			transition: 1s;
		}#fact2 {
			visibility: hidden;
		}#fact3 {
			visibility: hidden;
		}#fact4 {
			visibility: hidden;
		}#fact5 {
			visibility: hidden;
		}
		
/*		BALLOONS*/
		#b1 {
			transition: 7s;
			transition-timing-function: ease-in
		}
		#b2 {
			transition: 12s;
			
		}
		#b3 {
			transition: 9s;
			
		}
		#b4 {
			transition: 6s;
		}
		#b5 {
			transition: 8s;
			transition-delay: 2s;
		}
		#b6 {
			transition: 8s;
		}
		#fishprank {
			position: absolute;
			width: 500px;
			height: 500px;
			top: 0;
			bottom: 0;
			left: 0;
			right: 0;
			margin: auto;
			display: none;
			color: white;
			font-family: 'didot';
			font-size: 5em;
			z-index: 2000;
		}

		#fishprankinfo {
			position: absolute;
			width: 500px;
			height: 500px;
			top: 0;
			bottom: 0;
			left: 0;
			right: 0;
			margin: auto;
			display: none;
			color: white;
			font-family: 'didot';
			font-size: 5em;
			z-index: 2000;

		}
		
		#fish {
			transition: all 2s;
		}
		#bigfish {
			transition: linear 2s;
			transition-delay: 1s;
		}
		.hourHand {
   		 animation: animate-line 5s infinite;
  		  background: none repeat scroll 0px 0px transparent;
    border-top: 2px solid rgba(255, 255, 255, 0.5);
    display: block;
    position: absolute;
    z-index: 2000;
    height: 1px;
    -moz-transform: rotate(16deg);
    -webkit-transform: rotate(16deg);
    transform: rotate(16deg);
    left: 20px;
    top: 200px;
		}

		#news {
			transition: 4sec';
		}
		
	</style>
	

</head>

<body>
	<div id='fishprank'>
		<p>POISSON D'AVRIL!</p></div>
	<div id= 'fishprankinfo'></div>
	<div id='sky'></div>
	<!--BOOK OF FOOLS-->
	<div id='book'>
		<div id='list'>
			<h1> Book of Fools</h1>
			<p> People I need to prank this year...</p>
			<ul>
				<li id='fooled'></li>
			</ul>
		</div>
		<div class='display'></div>
	</div>
